import { ReadJob } from '../../api'
import { GetDateTime, ReportSort } from '../../DataRequest/LogDataRequestWrap';
import moment from 'moment';
import { Button } from 'antd';


let LogValue = {
    "LogC3": [],
    "LogG2": [],
}

let ReportList = {
    "C3ReportList": [],
    "G2ReportList": []
}

let JobDetailRecord = {
    datetimeStart: '',
    datetimeEnd: '',
    site: '',
    line: '',
    BufferName: ''
}

